<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Tale Documentation</title>
    <style>
        .error {
            color: #dc3545;
            padding: 20px;
            border: 1px solid #dc3545;
            border-radius: 4px;
            margin: 20px 0;
        }

        :root {
            --bg-color: #ffffff;
            --text-color: #000000;
            --link-color: #0366d6;
            --top-bar: rgba(224, 224, 224, 0.95);
            --top-barnk: #a5a5a5;
        }

        @media (prefers-color-scheme: dark) {
            :root {
                --bg-color: #1a1a1a;
                --text-color: #ffffff;
                --link-color: #58a6ff;
                --top-bar: rgba(28, 28, 30, 0.95);
                --top-barnk: #2c2c2e;
            }
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif;
            line-height: 1.6;
            margin: 0;
            padding: 20px;
            background-color: var(--bg-color);
            color: var(--text-color);
            max-width: 800px;
            margin: 0 auto;
        }

        .content {
            margin: 20px 0;
        }

        h1 { font-size: 2em; }
        h2 { font-size: 1.5em; }
        h3 { font-size: 1.17em; }

        img {
            max-width: 100%;
            height: auto;
            margin: 10px 0;
        }

        .center {
            text-align: center;
        }

        .loading {
            text-align: center;
            padding: 20px;
        }

        @media (max-width: 768px) {
            body {
                padding: 10px;
            }
        }

        .container {
            max-width: 1200px;
            margin: 0 auto;
            padding: 20px;
            top: 0; 
            left: 0;
            right: 0;
            height: 85px;
            background-color: var(--top-bar);
            backdrop-filter: blur(10px);
            border-bottom: 1px solid var(--top-barnk); 
            display: flex;
            justify-content: space-around;
            align-items: center;
            padding-bottom: 20px;
            z-index: 1000;
            border-radius: 20px;
        }

        .header-content {
            display: flex;
            justify-content: space-between;
            align-items: center;
            height: 100%;
        }

        a {
            color: var(--text-color); 
            text-decoration: underline; 
            transition: font-weight 0.2s ease;
        }


        a:hover {
            font-weight: bold;
        }

        .quotetale {
            margin: 18px 21px 16px 0;
            padding-left: 15px;
            position: relative;
            font-style: italic;
            word-wrap: break-word;
            border-left: 3px solid var(--text-color);
        }

        .docimg {
            opacity: 1;
            transition: opacity .15s ease;
            max-height: 690px;
        }

    </style>
</head>
